import style from './Form.module.css'
const Form = () => {

    return (
         <form className={style.container}>
                <div></div>
                <label htmlFor="">User Name: </label>
                    <input type="texte" name = "userName"></input>
                <label htmlFor=""> Password: </label>
                    <input type="text" name = "passWord"></input>
            </form>
    )
}

export default Form
